import React from 'react';

import logo from '../../img/mw-logo.png'

const Nav = () => {

    return (
        <div>
            <nav>
                <img id="nav-logo" src={logo} />
                <ul className="navbar-nav mr-auto">
                    <li className="nav-item">
                        <Link className="nav-link" to="/">Dashboard</Link>
                    </li>
                </ul>
            </nav>
        </div>
    )
}

export default Nav;
